import React from "react";
import { Col } from "antd";
import ChartRenderer from "../components/ChartRenderer";
import Dashboard from "../components/Dashboard";
import DashboardItem from "../components/DashboardItem";
import Select from 'react-select';
// import 'react-select/dist/react-select.css';

const DashboardItems = [
  {
    id: 0,
    name: "The Number of 311 Service Requests by Day",
    vizState: {
      query: {
        filters: [
          {
            dimension: "ServiceRequest311.city",
            operator: "contains",
            values: [
              "New"
            ]
          }
        ],
        measures: ["ServiceRequest311.count"],
        timeDimensions: [
          {
            dimension: "ServiceRequest311.createdDate",
            granularity: "day"
          }
        ]
      },
      chartType: "line"
    }
  }
];

const options = [
    { value: 'Stanford University', label: 'Stanford' }
];

const field = ({ options }) => (
    <Select
        name="university"
        value="one"
        options={options}
        onChange={val => console.log(val)}
    />
);



const DashboardPage = () => {
  const dashboardItem = item => (
    <Col
      span={24}
      lg={12}
      key={item.id}
      style={{
        marginBottom: "24px"
      }}
    >
      <DashboardItem title={item.name}>
        <ChartRenderer vizState={item.vizState} />
      </DashboardItem>
    </Col>
  );

  const Empty = () => (
    <div
      style={{
        textAlign: "center",
        padding: 12
      }}
    >
      <h2>
        There are no charts on this dashboard. Use Playground Build to add one.
      </h2>
    </div>
  );


  return DashboardItems.length ? (
    <Dashboard dashboardItems={DashboardItems}>
      {DashboardItems.map(field)}
      {DashboardItems.map(dashboardItem)}
    </Dashboard>
  ) : (
    <Empty />
  );
};

export default DashboardPage;
